import React from 'react';
import { ArrowRight, Scale, Users, BookOpen, Shield, Award, Phone } from 'lucide-react';

// Types
interface Service {
  title: string;
  items: string[];
}

interface HeroSectionProps {
  title: string;
  subtitle: string;
}

interface AboutSectionProps {
  title: string;
  content: string[];
  image: string;
}

interface ServicesSectionProps {
  title: string;
  services: Service[];
  image: string;
}

interface TeamSectionProps {
  title: string;
  content: string[];
  image: string;
}

interface ContactSectionProps {
  title: string;
  buttonText: string;
}

// Hero Section Component
const HeroSection: React.FC<HeroSectionProps> = ({ title, subtitle }) => (
